import React from 'react';
import './header.css';

const Header = () => {
  return (
    <div>
      <header className='Header'>
          
            <ul className='HeaderNav'>
              <li className='HeaderMenuNav'>Корзина</li>
              <li className='HeaderMenuNav'>Каталог</li>
              <li className='HeaderMenuNav'>FAQ</li>
              <li className='HeaderMenuNav'>Личный кабинет</li>
            </ul>
                  
      </header>
    </div>
  );
}

export default Header
